document.addEventListener("DOMContentLoaded", () => {
 {
		let t = 0;

		function e() {
			"loading..." !== $(".joe_census__filing .button").html() && $.ajax({
				url: Joe.BASE_API,
				type: "POST",
				dataType: "json",
				data: {
					routeType: "article_filing",
					page: ++t
				},
				success(t) {
					if (!t.length) return $(".joe_census__filing .item.load").remove(), Qmsg.warning(
						"没有更多内容了");
					let e = "";
					t.forEach(t => {
						e += `\n\t\t\t\t\t\t\t<div class="item">\n\t\t\t\t\t\t\t\t<div class="tail"></div>\n\t\t\t\t\t\t\t\t<div class="head"></div>\n\t\t\t\t\t\t\t\t<div class="wrapper">\n\t\t\t\t\t\t\t\t\t<div class="panel">${t.date}<svg viewBox="0 0 1024 1024" xmlns="http://www.w3.org/2000/svg"><path d="M21.6 772.8c28.8 28.8 74.4 28.8 103.2 0L512 385.6l387.2 387.2c28.8 28.8 74.4 28.8 103.2 0 28.8-28.8 28.8-74.4 0-103.2L615.2 282.4l-77.6-77.6c-14.4-14.4-37.6-14.4-51.2 0l-77.6 77.6L21.6 669.6c-28.8 28.8-28.8 75.2 0 103.2z" /></svg></div>\n\t\t\t\t\t\t\t\t\t<ol class="panel-body">\n\t\t\t\t\t\t\t\t\t\t${t.list.map(t=>`<li><a rel="noopener noreferrer" target="_blank" href="${t.permalink}">${t.title}</a></li>`).join("")}\n\t\t\t\t\t\t\t\t\t</ol>\n\t\t\t\t\t\t\t\t</div>\n\t\t\t\t\t\t\t</div>\n\t\t\t\t\t\t`
					}), $("#filing").append(e), $(".joe_census__filing .button").html("加载更多")
				}
			})
		}
		e(), $(".joe_census__filing .content").on("click", ".panel", function() {
			const t = $(this).parents(".content");
			t.find(".panel").not($(this)).removeClass("in"), t.find(".panel-body").not($(this).siblings(
				".panel-body")).stop().hide("fast"), $(this).toggleClass("in").siblings(
				".panel-body").stop().toggle("fast")
		}), $(".joe_census__filing .button").on("click", function() {
			e(), $(this).html("loading...")
		})
	}
});
